  '/api/auth/{mail}/{password}':
    get:
      summary: 'Find a registered user with the given email address and password.'
      operationId: findARegisteredUserWithTheGivenEmailAddressAndPassword
      description: ''
      parameters: []
      responses:
        200:
          description: ''
          content:
            application/json:
              schema:
                type: string
                example: 'Not A Registered User GO BACK'
      tags:
        - Endpoints
      security: []
    parameters:
      -
        in: path
        name: mail
        description: ''
        example: aut
        required: true
        schema:
          type: string
      -
        in: path
        name: password
        description: ''
        example: "bP!$w';GG"
        required: true
        schema:
          type: string
